import React from "react";

const TitleBar = ({ showBackButton }) => {
  return (
    <div className="flex items-center justify-between bg-blue-500 h-14 text-white font-['Cabin'] font-medium uppercase text-sm leading-6 py-2 px-4">
      {showBackButton && (
        <div className="cursor-pointer">
          <div class="w-[60px] h-[30px] px-4 py-1.5 bg-green-600 rounded shadow justify-center items-center gap-2 inline-flex">
            <div class="text-center text-white text-sm font-medium font-['Roboto'] uppercase leading-normal tracking-tight">
              Back
            </div>
          </div>{" "}
        </div>
      )}
      <div class="w-[250px] h-7 text-center text-white text-sm font-medium font-['Cabin'] uppercase leading-normal tracking-tight">
        WELLNEST: MOOD TRACKING FEATURE
      </div>
    </div>
  );
};

export default TitleBar;
